			 <TR>
			  <TD align='center' class='borderBR' colspan='15' style='background-image:url(/imagenes/cnc_menubar_gris.gif);'><div class='padding5'><B>SENSIBILIZACIÓN</B></div></TD>
			 </TR>
			 <TR>
			  <TD align='left' class='bb divInstruccion' valign='top'><div id='s39row3_1' class='padding5'><B>&nbsp;</B></div></TD>
			  <TD align='left' class='borderBR divInstruccion' colspan='20'><div id='s39row3_2' class='padding5'>Quiero iniciar agradeciéndole su tiempo, sus opiniones y el haber aceptado esta invitación del Centro Nacional de Consultoría.<br /><br />
Yo le voy a leer las preguntas tal cual como aparecen en el formulario para evitar variaciones entre un entrevistador y otro, no puedo explicar o comentar ninguna pregunta.<br /><br />
Las preguntas que le voy a hacer son muy similares entre procesos y servicios y se establecieron así para poderlas comparar.<br /><br />
Si hay alguna pregunta que no aplica o que no desea responder o cualquier otra razón, por favor dígamelo.</div></TD>
			  
			 </TR>
			 <TR>
			  <TD align='center' class='borderBR' colspan='15' style='background-image:url(/imagenes/cnc_menubar_gris.gif);'><div class='padding5'><B>PENSANDO EN SU MACROPROCESO</B></div></TD>
			 </TR>
			 <TR>
			  <TD align='left' class='bb divInstruccion' valign='top'><div id='s39row5_1' class='padding5'><B>&nbsp;</B></div></TD>
			  <TD align='left' class='borderBR divInstruccion' colspan=''><div id='s39row5_2' class='padding5'>&nbsp;</div></TD>
			  <TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row5_3' class='padding2'>Se han reconocido los problemas, no existen procesos estándar para solucionarlos, las soluciones son específicas o propias.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row5_4' class='padding2'>La gestión de la organización se realiza por dependencias y se documentan procesos por requisito del SGC.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row5_5' class='padding2'>Los procesos están alineados con la estrategia y se han estandarizado documentado y difundido y los colaboradores inician su utilización.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row5_6' class='padding2'>Se mide y monitorea el desempeño de los procesos (no áreas) y se mejoran continuamente. Los colaboradores ejecutan su proceso de manera sistemática.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row5_7' class='padding2'>Se demuestra que el proceso ha contribuido con el logro de la estrategia y es una mejor práctica comparable o superior con la industria mundial.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row5_8' class='padding2'>NS/NR</div></TD>
			 </TR>
