				  <TD align='left' class='bb' valign='top'><div id='s39row43_1' class='padding5' style="display:block"><B>22a.</B></div></TD>
				  <TD align='left' class='borderBR' colspan='12'><div id='s39row43_3' class='padding5' style="display:block">¿Que oportunidades de mejora considera usted que tiene el macroproceso?<BR /><TEXTAREA name='vb_pg22' id='vb_pg22' lang='1' title='Por favor responder la pregunta 22a' class='borderBlue' style='width:99%; height:50px;'></TEXTAREA></div></TD>
