			 <TR>
			  <TD align='left' class='bb divInstruccion' valign='top'><div id='s39row44_1' class='padding5'><B>&nbsp;</B></div></TD>
			  <TD align='left' class='borderBR divInstruccion' colspan=''><div id='s39row44_2' class='padding5'>&nbsp;</div></TD>
			  <TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row44_3' class='padding2'>Se han reconocido los problemas, no existen procesos estándar para solucionarlos, las soluciones son específicas o propias.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row44_4' class='padding2'>La gestión de la organización se realiza por dependencias y se documentan procesos por requisito del SGC.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row44_5' class='padding2'>Los procesos están alineados con la estrategia y se han estandarizado documentado y difundido y los colaboradores inician su utilización.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row44_6' class='padding2'>Se mide y monitorea el desempeño de los procesos (no áreas) y se mejoran continuamente. Los colaboradores ejecutan su proceso de manera sistemática.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row44_7' class='padding2'>Se demuestra que el proceso ha contribuido con el logro de la estrategia y es una mejor práctica comparable o superior con la industria mundial.</div></TD><TD align='center' class='borderBR divInstruccion' colspan='2' ><div id='s39row44_8' class='padding2'>NS/NR</div></TD>
